import React, { Component } from 'react';
import Slider from 'react-slick';
import './Stories.css';

export default class SimpleSlider extends Component {
  render() {
    const settings = {
      dots: false,
      infinite: true,
      speed: 500,
      slidesToShow: 6,
      slidesToScroll: 1,
      arrows: true,
    };
    return (
      <div>
        <h2> Single Item</h2>
        <Slider {...settings}>
          <div className="slider-item">
            <h3>1</h3>
          </div>
          <div className="slider-item">
            <h3>2</h3>
          </div>
          <div className="slider-item">
            <h3>3</h3>
          </div>
          <div className="slider-item">
            <h3>4</h3>
          </div>
          <div className="slider-item">
            <h3>5</h3>
          </div>
          <div className="slider-item">
            <h3>6</h3>
          </div>
        </Slider>
      </div>
    );
  }
}
